import React from "react";
import WithLayout from "../../../components/Landlrd/Layout";
import { Container } from "../../../components/styledComponents";
import SingleHouse from "../../../components/Landlrd/houses/SingleHouse";
import HouseQuery from "../../../components/queryComponents"
const House = ({ query, ...other }) => {
  const { id } = query;
  console.log(id);
  return (
    <House id={id}>
      {({ data, loading, error }) => {
        if (data) {
          return (
            <Container flex={1}>
              <SingleHouse {...other} />
            </Container>
          );
        }
        return null;
      }}
    </House>
  );
};

export default WithLayout(House);
